import React from 'react';
import PropTypes from 'prop-types';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import { withStyles } from '@material-ui/core/styles';
import GridListItem from 'components/grid-list-item'
import withWidth, { isWidthUp } from '@material-ui/core/withWidth';

import './grid-list.css'

const styles = theme => ({
  grid: {
    [theme.breakpoints.down('md')]: {
      height: 3
    },
  },
});

const TitlebarGridList = ({ data, width }) => {
  return (
    <div className="root">
      <GridList cols = {isWidthUp('lg', 'md', width) ? 1 : 2} cellHeight={270} spacing={15} className='grid-list' >
        {
           data.map( (item) => {
              return   <GridListTile
                        key = {item.id}>
                          <GridListItem
                              {...item}
                            />
                        </GridListTile>
            }
          )
        }
      </GridList>
    </div>
  );
}


export default withWidth()(TitlebarGridList);
